import numpy as np
from pytracking.evaluation.data import Sequence, BaseDataset, SequenceList
from pytracking.utils.load_text import load_text
import cv2 as cv

def OxuvaDataset():
    return OxuvaDatasetClass().get_sequence_list()

class OxuvaDatasetClass(BaseDataset):
    def __init__(self):
        super().__init__()
        self.base_path = self.env_settings.oxuva_path
        self.sequence_info_list = self._get_sequence_info_list()

    def get_sequence_list(self):
        return SequenceList([self._construct_sequence(s) for s in self.sequence_info_list])

    def _construct_sequence(self, sequence_info):
        sequence_path = sequence_info['path']
        nz = sequence_info['nz']
        ext = sequence_info['ext']
        start_frame = sequence_info['startFrame']
        end_frame = sequence_info['endFrame']
        obj_id = sequence_info['object_id']

        frames = ['{base_path}/{sequence_path}/{frame:0{nz}}.{ext}'.format(base_path=self.base_path, 
        sequence_path=sequence_path, frame=frame_num, nz=nz, ext=ext) for frame_num in range(start_frame, end_frame+1)]

        im = cv.imread(frames[0])
        height, width, _ = im.shape

        gt = list(map(float,sequence_info['gt']))

        ground_truth_rect = np.array([[gt[0]*width, gt[2]*height, (gt[1]-gt[0])*width, (gt[3]-gt[2])*height]])

        return Sequence(sequence_info['name'], frames, ground_truth_rect, dataset='oxuva', object_ids=[obj_id])

